import React, { Component, useState } from "react";
import DatePicker from "react-datepicker";

import "react-datepicker/dist/react-datepicker.css";

class App extends Component {
    state = {
        startDate: new Date(),
        monday: {
            from: "",
            to: ""
        }
    };

    render() {
        return (
            <div>
            <DatePicker
                selected={this.state.startDate}
                onChange={date => this.handleChange(date)}
                showTimeSelect
                showTimeSelectOnly
                timeIntervals={20}
                timeCaption="Time"
                dateFormat="h:mm aa"
            />
            <DatePicker
                selected={this.state.startDate}
                onChange={date => this.handleChange(date)}
                showTimeSelect
                showTimeSelectOnly
                timeIntervals={20}
                timeCaption="Time"
                dateFormat="h:mm aa"
            />
            </div>
        );
    }

    handleChange = async date => {
        console.log(date);
        await this.setState({ startDate: date });
        console.log(String(this.state.startDate).match(/\d{2}:\d{2}/g)[0]);

    };
}

export default App;
